import React from "react";

const KanbanCard = (id, title, username) => {
    return (
        <div className="p-2 rounded shadow-sm border-gray-100 border-2">
            <h3 className="text-sm mb-3 text-gray-700"><strong>#{id}</strong> {title}</h3>

            <div className="flex flex-row items-center mt-2">
                <div className="bg-gray-300 rounded-full w-4 h-4 mr-3"></div>
                <a href="/" className="text-xs text-gray-500">{username}</a>
            </div>
        </div>
    );
};

export default KanbanCard;
